{"id": 15700507, "title": "Продаю 3к квартиру 95.1 кв. м, Свердлова улица 114   в районе Свердловский массив в Виннице", "position": 74, "price_usd": 80000.0, "price_uah": 2035623.0, "number_rooms": 3, "floor_located": 7, "number_of_floors_in_the_house": 12, "apartment_area": 95.1, "offer_type": "от собственника", "wall_type": "кирпич", "construction_period": "Сдача в 2017", "heating": "индивидуальное", "city_id": 1, "city_name": "Винница", "latitude": "", "longitude": "", "description": "Продаю собственную квартиру, без комиссии АН! в новом жилом комплексе \"Резиденция над Бугом\". Секция сдана и заселена более чем на 70%. Вокруг секции устелена брусчатка, двор озеленен. В квартире завершен ремонт в мае 2018 года. Так как ремонт делался для себя (с использованием высококачественных материалов и соблюдением технологий), отсутствуют \"болячки\" новостроек в виде \"паутинок\" на окрашенных стенах, \"микротрещин на гипсокартоне\" и т.д. С панорамного окна спальни открывается прекрасный вид на Южный Буг, а также панорама на Старый город. Окна детской, гостиной и кухни выходят на двор \"Ривьеры\" и частный сектор. 50 метров квадратных подогреваемого пола будет вам греть ноги и дарить уют в самый холодный вечер, установлен кондиционер для комфортного климата в жаркие летние дни, декоративный камин с возможностью обогрева (2 кВт), двухконтурный котел с термостатом, регулятор напряжения, УЗО, полностью осуществлена разводка ТВ, интернет кабелей, а также осуществлены все подготовительные работы для установки видеодомофона с IP-передачей данных по WI-FI. Дизайн гостиной выполнен в стилистике американской классики, спальня - прованс, кухня-столовая - ретро-кафетерий. В квартире остается угловой диван, практически новый мебельный гарнитур в гостиной и шкаф-купе, также все источники света и элементы декора . Тамбур закрыт алюминиевыми дверьми со стеклопакетом (на 2 квартиры). В доме грузопассажирский лифт рассчитанный на 1 тонну, установлено видеонаблюдение со свободным доступом для жильцов через WI-FI, домофон с возможностью подключения видео. Подъезд автомобилем к дому со стороны Льва Толстого. Рядом школы, садики, магазин, зона отдыха \"Спартак\", до центра пешком до 15 мин. До остановки Пирогово 7 мин. При покупке квартиры от собственника Вы экономите 4% от сумы сделки!!!", "tags": ["Вторичное жилье"], "image_urls": ["https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500035/1500035l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500034/1500034l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500040/1500040l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500038/1500038l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500037/1500037l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500045/1500045l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500044/1500044l.jpg?v=15164", "https://cdn.riastatic.com/photos/dom/panoramas/150/15000/1500043/1500043l.jpg?v=15164"], "absolute_url": "https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-vinnitsa-tsentr-sverdlova-ulitsa-15700507.html"}
