{"id": 15561256, "title": "Продаю 3к квартиру 90.1 кв. м, Клочковская улица 191-А возле метро Научная  в районе Шевченковский в Харькове", "position": 9, "price_usd": 96000.0, "price_uah": 2442748.0, "number_rooms": 3, "floor_located": 9, "number_of_floors_in_the_house": 10, "apartment_area": 90.1, "offer_type": "от собственника", "wall_type": "кирпич", "construction_period": "2009", "heating": "централизованное", "city_id": 7, "city_name": "Харьков", "latitude": "", "longitude": "", "description": "В связи с переездом в другую страну, Продам СВОЮ современную, уютную трехкомнатную квартиру в новостройке, расположенной по ул. Клочковской, 191-А. Дом сдан в эксплуатацию в 2009 году. Построен из белого кирпича и имеет хорошую шумоизоляцию. Квартира находится на 9 этаже 10-ти этажного дома. Общая площадь - 90, 1 кв.м., высота потолков – 2, 75, имеется 2 застекленные лоджии. В квартире в 2014 году сделан евроремонт из качественных материалов. С 2015 года по настоящее время квартирой мы не пользовались. В ней имеется: дизайнерская мебель, встроенные шкафы из гипоаллергенных материалов, встроенная техника(плита, духовой шкаф, посудомоечная машина, холодильник), полы с подогревом, охранная сигнализация, домофоны, кондиционеры, интернет, итальянские шторы, сантехника Grohe, гардеробная. Все перечисленное остается новым хозяевам. Интеллигентные, тихие соседи. Возле дома охраняемая, закрытая стоянка. Преимуществом дома, является, непосредственная близость к центру города и развитая инфраструктура района (школы, садики, гимназия, молочная кухня, супермаркеты: Восторг, АТБ, Будмен, Дигма, поликлиника, спорткомплекс «YOD», детские площадки, сквер, Сосновая горка). В подъезде установлен счетчик тепла, что существенно экономит расходы в отопительный сезон. В квартире установлены счетчики холодной и горячей воды.", "tags": ["Торг", "Вторичное жилье"], "image_urls": ["https://cdn.riastatic.com/photos/dom/panoramas/148/14805/1480523/1480523l.jpg?v=13589", "https://cdn.riastatic.com/ph