{"id": 15950931, "title": "Продаю 7к квартиру 226 кв. м, Академічна улица   в районе Пирогово в Виннице", "position": 7, "price_usd": 105000.0, "price_uah": 2671755.0, "number_rooms": 7, "floor_located": 7, "number_of_floors_in_the_house": 8, "apartment_area": 226, "offer_type": "от посредника", "wall_type": "кирпич", "construction_period": "", "heating": "индивидуальное", "city_id": 1, "city_name": "Винница", "latitude": "", "longitude": "", "description": "Продається простора квартира для великої і щасливої родини в престижному районі Пирогово. Свіже повітря, затишна вулиця, неймовірні краєвиди з вікон і терас. Спеціально обладнаний дах під зону відпочинку. Смажте свіжі стейки, вмощуйтесь на зручні канапи і насолоджуйтесь неймовірною природою поруч. Квартира утеплена( надамо рахунки за комун послуги, які доведуть, що платежі мінімальні, як для такої площі), з кондеціонерами, теплою підлогою. Добротний ремонт, якісні меблі. Усе робилось зі смаком та любов'ю. Зручна транспортна розв'язка. Є гараж, паркомісце, кладовка( у вартість квартири не входять, ціна за домовленісттю).Поруч Ботанічний сад, садиба Пирогова, школа, садочок, магазини, кафе. Квартира: 226 м. кв. 7 кімнат: 3 просторі спальні, кабінет з кінотеатром, спеціально обладнана каладова, ігрова кімната для діток, гостьва кімната, 2 санвузла, 2 розкішні тераси. На утепленому даху є можливість встановлення сонячних батарей. Вона варта набагато більше, аніж коштує. Ця квартира для нас стала завеликою, тому \"передамо\" її іншій родині, яка тут обов'язково буде щасливою. Замовляйте перегляд і живіть в комфорті та розкошші. Відповім на всі Ваші запитання", "tags": ["Вторичное жилье"], "image_urls": ["https://cdn.riastatic.com/photos/dom/panoramas/153/15395/1539591/1539591l.jpg?v=18066", "https://cdn.riastatic.com/photos/dom/panoramas/153/15395/1539586/1539586l.jpg?v=18066", "https://cdn.riastatic.com/photos/dom/panoramas/153/15395/1539587/1539587l.jpg?v=18066", "https://cdn.riastatic.com/photos/dom/panoramas/153/