{"id": 13650837, "title": "Продаю 2к квартиру 65.5 кв. м, Шолохова улица 39а   в районе Амур-Нижнеднепровский в Днепропетровске", "position": 7, "price_usd": 59000.0, "price_uah": 1501272.0, "number_rooms": 2, "floor_located": 8, "number_of_floors_in_the_house": 9, "apartment_area": 65.5, "offer_type": "от собственника", "wall_type": "монолитно-блочный", "construction_period": "2015, II кв.", "heating": "индивидуальное", "city_id": 11, "city_name": "Днепропетровск", "latitude": 48.499399470966, "longitude": 34.992887655325, "description": "Скидка 5000$ до конца лета, после цена будет 64000$, жм Фрунзенский, ул Шолохова 39а, дом построен 2015, 2-x комнатная студия с дизайнерским ремонтом в новом доме. Рядом отличная набережная, вдоль Днепра на которой часто проводят разные интересные мероприятия. Рядом с домом лодочная станция, очень удобно если у вас есть лодка или вы любите рыбачить. Очень тихое и спокойное место, гуляем с ребенком каждый день, в пределах 500 метров есть магазин, остановка маршрутного такси 23 до центра, банкомат, кафе на берегу Днепра. До школы 1км. Продаем с частичной техникой и мебелью. Дорогая сантехника, мебель делалась на заказ, в студии кухня, барная стойка, стул и небольшой шкаф сделаны с одного материала, это очень вписывается в интерьер. В одной спальне, вся мебель на заказ, которая гармонирует с ремонтом, все сделано в японском стиле, даже входная раздвижная дверь! Так же в этой спальне стоит приточная машина с очень хорошей фильтрацией, даже если под окнами распалят костер, в квартире не будет запаха дыма и еще это позволяет всегда проветривать квартиру, даже в зимний период времени. Детская имеет теплый пол и большое окно, так же есть 3 варианта света, один из них очень хороший для работы вечером. В ванной комнате теплый пол. Во всей квартире энергосберегающии лампочки. Есть видеонаблюдение и сигнализация в квартире, а так же есть охрана дома. Дом находиться рядом с р. Днепр, рядом с домом садик. В квартире двух контурный котел. Есть два кондиционера, газовая плита, духовка, посудомоечная машина, стиральная машина. Пол ламинат. Есть фильтр на квартиру, для крупного мусора и ржавчины. Все в квартире делалось для себя, не экономили ни на чем. Есть вопросы звоните!", "tags": ["Торг", "Обмен", "Рассрочка/Кредит", "Вторичное жилье"], "image_urls": ["https://cdn.riastatic.com/photos/dom/panoramas/152/15201/1520159/1520159l.jpg?v=19791", "https://cdn.riastatic.com/photos/dom/panoramas/152/15201/1520157/1520157l.jpg?v=19791", "https://cdn.riastatic.com/photos/dom/panoramas/152/15201/1520158/1520158l.jpg?v=19791", "https://cdn.riastatic.com/photos/dom/panoramas/152/15201/1520160/1520160l.jpg?v=19791", "https://cdn.riastatic.com/photos/dom/panoramas/152/15201/1520161/1520161l.jpg?v=19791", "https://cdn.riastatic.com/photos/dom/panoramas/118/11806/1180658/1180658l.jpg?v=19791", "https://cdn.riastatic.com/photos/dom/panoramas/152/15201/1520156/1520156l.jpg?v=19791", "https://cdn.riastatic.com/photosnew/dom/photo/perevireno-prodaja-kvartira-dnepropetrovsk-amurnijnedneprovskiy-sholohova-ulitsa__99786213f.jpg"], "absolute_url": "https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-dnepropetrovsk-amurnijnedneprovskiy-sholohova-ulitsa-13650837.html"}
