{"id": 15648760, "title": "Продаю 2к квартиру 82 кв. м, Победы проспект 131А   в районе Святошинский в Киеве", "position": 5, "price_usd": 63500.0, "price_uah": 1615776.0, "number_rooms": 2, "floor_located": 11, "number_of_floors_in_the_house": 26, "apartment_area": 82, "offer_type": "от посредника", "wall_type": "монолит", "construction_period": "", "heating": "централизованное", "city_id": 10, "city_name": "Киев", "latitude": 50.4544599, "longitude": 30.3517358, "description": "Продам 2-х комнатную квартиру, Святошинский р-н, на проспекте Победы 131-А, ЖК \"Аквамарин\" (2-я секция). Квартира площадью 82/44/11 м2 расположена на 11 этаже /24 этажного дома. Монолитно-каркасный дом 2012 года. Просторная, светлая, квартира с современной функциональной планировкой. Без ремонта. Частично поштукатурены стены, сделана эл. разводка. Дом введем в эксплуатацию, есть все документы, право собственности. Заключены договора с водоканалом, Киевэнерго. Дом расположен в зеленой зоне, имеет презентабельную входную группу, подъезды на кодовый замок, охрана дома и территории, детская площадка. Есть свои 2 паркоместа возле дома. Из окон открывается панорамный вид на лес. Отличное место расположение: рядом парк, супермаркеты, рынок, детские учреждения, ст. метро \"Житомирская\"  7 мин. пешком. Номер объявления на сайте компании: SF-1-159-527-DR.", "tags": ["Первичное жилье"], "image_urls": ["https://cdn.riastatic.com/photos/dom/panoramas/150/15038/1503841/1503841l.jpg?v=17603", "https://cdn.riastatic.com/photos/dom/panoramas/150/15038/1503839/1503839l.jpg?v=17603", "https://cdn.riastatic.com/photos/dom/panoramas/150/15038/1503840/1503840l.jpg?v=17603", "https://cdn.riastatic.com/photos/dom/panoramas/150/15038/1503842/1503842l.jpg?v=17603", "https://cdn.riastatic.com/photos/dom/panoramas/150/15038/1503838/1503838l.jpg?v=17603", "https://cdn.riastatic.com/photosnew/dom/photo/perevireno-prodaja-kvartira-kiev-svyatoshinskiy-pobedyi-prospekt__98258804f.jpg", "https://cdn.riastatic.com/photosn