{"id": 14903590, "title": "Продаю 4к квартиру 158.4 кв. м, Вернадского улицп   в районе Центр в Харькове", "position": 9, "price_usd": 130000.0, "price_uah": 3307888.0, "number_rooms": 4, "floor_located": 2, "number_of_floors_in_the_house": 10, "apartment_area": 158.4, "offer_type": "от собственника", "wall_type": "кирпич", "construction_period": "2001-2005", "heating": "централизованное", "city_id": 7, "city_name": "Харьков", "latitude": "", "longitude": "", "description": "Продается просторная квартира в центре Харькова по улице Вернадского 1 в кирпичном доме. Этажность – 2/10. Площадь квартиры – 158.4 кв.м. (общая), 119 кв.м. (жилая). Квартира состоит из 4 комнат (17 кв.м., 35.8 кв.м., 26.3 кв.м., и 40.2 кв.2, которые объеденены с кухней (11.6 кв.м.)), туалет – 2.3 кв.м., ванная – 6.0 кв.м, коридор 17.2 кв.м. Высота потолков – 2.7 м. Окна выходят во двор с обоих сторон. Несмотря на близкое расположение к проспекту Гагарина, двор очень тихий. Во дворе есть детская площадка, мини поле для футбола, в 2-3 минутах ходьбы – метро Проспект Гагарина (220 метров от подъезда), в 3 минутах ходьбы – Харьковская набережная, по которой приятно гулять с детьми или заниматься утренней/вечерней пробежкой. Рядом с домом два супермаркета – АТБ и Сокол, много небольших магазинчиков; детский магазин Антошка; магазин электроники Фокстрот и Эльдорадо, отделения банков (Приватбанк, Укрсиббанк, ВТБ Банк, Правексбанк и банкомат Райфайзен Банка Аваль). До ЖД Станции Харьков-Левада – 550 метров, Автовокзала – 650 метров. Ближайшая больница и поликлиника в 10 минутах ходьбы от дома. Район очень зеленый и, что не менее важно, безопасный.", "tags": ["Торг", "Вторичное жилье"], "image_urls": ["https://cdn.riastatic.com/photos/dom/panoramas/138/13831/1383176/1383176l.jpg?v=18191", "https://cdn.riastatic.com/photos/dom/panoramas/138/13831/1383177/1383177l.jpg?v=18191", "https://cdn.riastatic.com/photos/dom/panoramas/138/13831/1383178/1383178l.jpg?v=18191", "https://cdn.riastatic.com/photos/dom/pa