{"id": 15982293, "title": "Продаю 1к квартиру 38 кв. м, Каховская улица возле метро Левобережная  в районе Днепровский в Киеве", "position": 7, "price_usd": 41000.0, "price_uah": 1043257.0, "number_rooms": 1, "floor_located": 2, "number_of_floors_in_the_house": 25, "apartment_area": 38, "offer_type": "от собственника", "wall_type": "кирпич", "construction_period": "Сдача в 2018", "heating": "централизованное", "city_id": 10, "city_name": "Киев", "latitude": 50.461933792362, "longitude": 30.591961336523, "description": "Дом введен в эксплуатацию ! С ПОСРЕДНИКАМИ НЕ СОТРУДНИЧАЮ!!!! Этажность: 25 этажей, в том числе 1-й этаж - нежилые помещения. Конструктивная схема здания: монолитный железобетонный каркас. Стены: - наружные - керамзитобетонные блоки с внешним утеплением базальтовой ватой и декоративной штукатуркой фасада по сетке; - внутренние межквартирные - кирпичные толщ. 250мм. Перегородки: - межкомнатные - керамзитобетонные блоки толщ. 100мм; - в санузлах и ванных комнатах - кирпичные толщ. 120мм. Перекрытия: монолитное железобетонное в единой схеме каркаса. Кровля: плоская с внутренним водоотводом, утеплением минеральной ватой и рулонной гидроизоляцией. Мусоропровод: проектом не предусмотрен. Количество лифтов - 3: - 1 лифт грузоподъемностью 1000кг (рассчитан также на работу в режиме «пожар»); - 2 лифта грузоподъемностью 630кг. Высота типового этажа: 3, 0 м (от пола до пола).Заполнение проемов: - входные двери в квартиру - металлические, противоударные; - внутренние двери в квартире - не устанавливаются; - окна, балконные двери в квартире - металлопластиковые с двухкамерным стеклопакетом;  Внутренние отделочные работы: - полы: в квартире выполняется цементно-песчаная стяжка по технологии «плавающий пол», в санузлах - обмазочная гидроизоляция и цементно-песчаная стяжка; - стены в жилых комнатах, коридорах, кухнях и санузлах - без отделки. Тип плиты: электроплита не устанавливаются. Электропитание квартиры: устанавливается распределительный щиток, одна розетка в к