{"id": 15711857, "title": "Продаю 2к квартиру 66.7 кв. м, Николая Ушакова улица возле метро Академгородок  в районе Святошинский в Киеве", "position": 7, "price_usd": 52000.0, "price_uah": 1323155.0, "number_rooms": 2, "floor_located": 7, "number_of_floors_in_the_house": 9, "apartment_area": 66.7, "offer_type": "от собственника", "wall_type": "кирпич", "construction_period": "1990-2000", "heating": "централизованное", "city_id": 10, "city_name": "Киев", "latitude": "50.45724113616746", "longitude": "30.340681055819687", "description": "Все приватизировано и оформлено как положено, прописан 1 взрослый человек. Детей нет и прочих проблем тоже нет. Квартира может быть готова к заселению, в течении недели. Локация : Академгородок, массив Беличи, ул. Николая Ушакова 10. Очень чистая и светлая 2-х! комнатная квартира, расположенная на 7м этаже 9-ти этажного дома с видом на озеро. Чешский проект, общая площадь - 66.7 кв.м., жилая -33.5 кв.м, кухня- 10, 7 кв.м. Большой застекленный балкон по периметру всей квартиры. Вынесен, обшит, не утеплен. С/у – совместный. Квартира с добротным капитальным ремонтом. Можно сразу заехать и жить. Без опекунского. Парадное на кодовом замке. Цена с мебелью и техникой. План квартиры и тех паспорт и документы по запросу в личку. ув. Риелтор и посредники не беспокойте, если нет клиентов, вся нужная информация доступна в объявлении. Для переселенцев и сильно нуждающимся, можем еще немного уступить в цене. Прекрасное место - парковая зона. До ст. метро «Академгородок или Житомерская» - 10-15 минут пешком, 5 мин на маршрутке прямо от дома, до остального общественного транспорта – 3-5 минут. Отличная инфраструктура один из лучших районов Киева.", "tags": ["Вторичное жилье"], "image_urls": ["https://img.youtube.com/vi/PrJtGFN99o8/2.jpg", "https://cdn.riastatic.com/photos/dom/panoramas/151/15161/1516135/1516135l.jpg?v=18245", "https://cdn.riastatic.com/photos/dom/panoramas/151/15161/1516133/1516133l.jpg?v=18245", "https://cdn.riastatic.com/photos/dom