{"id": 16011886, "title": "Продаю 3к квартиру 114.5 кв. м, Дмитриевская улица 56 А   в районе Шевченковский в Киеве", "position": null, "price_usd": 105000.0, "price_uah": 2671755.0, "number_rooms": 3, "floor_located": 11, "number_of_floors_in_the_house": 11, "apartment_area": 114.5, "offer_type": "от представителя хозяина (без комиссионных)", "wall_type": "кирпич", "construction_period": "", "heating": "централизованное", "city_id": 10, "city_name": "Киев", "latitude": 50.453172945896, "longitude": 30.488746412967, "description": "Вашему вниманию предлагается уникальная возможность приобрести квартиру в тихом центре Киева по цене квартиры в спальном районе. Общая площадь 114.5 м2, с ремонтом, мебелью, бытовой техникой, и самое главное = по рыночной стоимости. Рыночную стоимость сформируют сами участники рынка, которые придут на осмотр квартиры, выразят своё желание купить путём заполнения оферты. Оферта не обязывает покупать, её роль = регуляция отношений между потенциальными покупателями для определения рыночной стоимости объекта ими самими же. Оферты будут приниматься, начиная с стартовой стоимости 105000$. Среди всех согласившихся купить квартиру путём переговоров определится победитель = наш идеальный покупатель, который предложит максимальную сумму за квартиру. Подписание нотариального предварительного или основного Договора Купли-Продажи состоится 27го августа 2019 года во Вторник, у выбранного Победителем Нотариуса. Документы к проведению сделки готовы, оценка будет получена накануне подписания. День открытых дверей для проведения осмотров 22 августа Четверг. Покупатель должен быть готов оформить нотариально отношения с Продавцом квартиры 27го августа 2019 года.", "tags": ["Вторичное жилье"], "image_urls": ["https://img.youtube.com/vi/rmbS-sW5sNE/2.jpg", "https://cdn.riastatic.com/photos/dom/panoramas/155/15521/1552171/1552171l.jpg?v=17306", "https://cdn.riastatic.com/photos/dom/panoramas/155/15521/1552172/1552172l.jpg?v=17306", "https://cdn.riastatic.com/ph